fields.description:
Продается 2 к.кв. квартира 
- пластиковые окна; 
- линолеум; 
- натяжные потолки; 
- санузел раздельный 
- удобная планировка 
- кухонный гарнитур, встраиваемые шкафы в ПОДАРОК!

На кухне остаётся: 
- кухонный гарнитур; 
- духовой шкаф (Leran); 
- варочная панель (Leran); 
- вытяжка (Leran); 
- микроволновая печь (Leran); 
- холодильник (LG); 
- тюль на окнах; 
В зале: 
- встроенный шкаф; 
- диван; 
- ковер; 
- шторы; 
- тюль на окнах; 
В ванной: 
- стиральная машина (Samsung); 
- пенал, зеркало с подсветкой.
